import React, { Fragment } from 'react';

export const TransactionList = () => {
  return (
    <Fragment>
      <h3>History</h3>
      <ul id='list' className='list'>
        <button className='minus'>
          Cash <span>-$400</span>
          <button className='delete-btn'>x</button>
        </button>
      </ul>
    </Fragment>
  );
};
